import React, { Component } from "react";
import "materialize-css/dist/css/materialize.min.css";
import M from "materialize-css/dist/js/materialize.min.js";

class BroodjeMenu extends Component {
  state = {};

  componentDidMount() {
    M.AutoInit();
  }

  render() {
    const { broodje } = this.props;
    const menuList = (
      <select>
        {" "}
        {props.broodje.map((x, y) => (
          <div className="broodjeMenu">
            <option key={y}>{x}</option>
            {/* <option value="2">{broodjeMenu.boter}</option>
          <option value="3">{broodjeMenu.beleg}</option> */}
          </div>
        ))}
      </select>
    );

    return (
      <div className="container">
        <div className="input-field col s12">
          <select defaultValue="">
            <option value="" disabled>
              Broodsoort
            </option>
            {menuList}
          </select>
        </div>
      </div>
    );
  }
}

export default BroodjeMenu;
